export default (second: number, WrappedComponent: any) => {
    const [isAppear, setIsAppear] = useState(false);
    useEffect(() => {
        setTimeout(() => {
            setIsAppear(true);
        }, (5 * 1000));
    }, [])
    const displayAfter = ({ ...props }) => isAppear ? '' : <WrappedComponent {...props} />


    return displayAfter;
}
